pragma solidity >=0.4.21 <0.6.0;
pragma experimental ABIEncoderV2;
import './MediaContract.sol';
contract PlaylistContract {
    MediaContract mediacontract;
    event playlist_event(uint256 indexed value1);
    //Meida Information 
    string[] MediaContent_Local ;
    string meida_name_Local;
    string meida_checksum_Local;

    //Playlist uint 
    uint public count;
    //Map Playlist 
    mapping(uint256 => Playlist) public PlaylistStores;
    Playlist[] public PlaylistArray;

    struct Playlist{
        uint playlistId;  
        string playlistname;    
        string[] Mediafile_name;
        string[] Mediafile_check;
        bool Media_Check;
    }

    function test_playlist() public {
        //value_test processing
        // emit test_value(value_test); // log the current value
    }
    // Must do 
    function getMediaContract(address MediaAddress) public {
        mediacontract = MediaContract(MediaAddress);
    }
    function addplaylist(string memory _name,string[] memory _mediaName,string[] memory _checksum ) public{

        PlaylistStores[count].playlistId = count; 
        PlaylistStores[count].playlistname = _name; 
        PlaylistStores[count].Mediafile_name = _mediaName;
        PlaylistStores[count].Mediafile_check = _checksum;
        //Check Media File
        bool checkStatus = checkMeida(count, _mediaName, _checksum);
        PlaylistStores[count].Media_Check = checkStatus;

        PlaylistArray.push(PlaylistStores[count]);
        count ++;
    }
    //Get Media All Information
    function getplaylist(uint _playlistId) public view returns(Playlist memory){
        Playlist storage b1 = PlaylistStores[_playlistId];
        return b1;
    }
    //Get Media All Information
    function getplaylistlength() public view returns(uint){
        return PlaylistArray.length;
    }

    function checkMeida(uint PlaylistId, string[] memory _Name, string[] memory _checksum) public view returns(bool){

        //Need to Check Media Content 
        uint checksum_Size = _checksum.length;
        uint Name_Size = _Name.length;
        //all _checksum length 
        bool checksum_status = false;
        //if Get Size and Name is not identical
        if(checksum_Size != Name_Size){
            return checksum_status;
        }
        //Call MediaContract to check CheckSum and Name
        for(uint size = 0;size < PlaylistStores[PlaylistId].Mediafile_check.length ; size ++){
            checksum_status = mediacontract.CheckMediaSum(_Name[size], _checksum[size]);
            if(checksum_status==false){
                return checksum_status;
            }
        }  
        return checksum_status;
    }
    //Get the Playlist of MediaStatus
    function getplaylistStatus(uint _playlistid) public view returns(bool){
        return PlaylistStores[_playlistid].Media_Check;
    }



